#include <bits/stdc++.h>
using namespace std;

#define Test

const int N = 500 + 10;
int memo[N][N][4][2];

class Solution {
public:
    int lenOfVDiagonal(vector<vector<int>>& grid) {
        ans = 0;
        m = grid.size(), n = grid[0].size();
        cnt = 0;
        int flag = 0;
        
        // vector<vector<vector<vector<int>>>> memo(m, vector<vector<vector<int>>>(n, vector<vector<int>>(4, vector<int>(2, -1))));
        // vector memo(m, vector<array<array<int, 2>, 4>>(n));

        for (int i = 0;i < m;i ++) {
            for(int j = 0;j < n;j ++) {
                for (int k = 0;k < 4;k ++) {
                    for (int p = 0;p < 2;p ++) {
                        memo[i][j][k][p] = 0;
                    }
                }
            }
        }
        for (int i = 0;i < m;i ++) {
            for (int j = 0;j < n;j ++) {
                if(grid[i][j] == 1) {
                    for (int index = 0;index < 4;index ++) {
                        int t = Dfs(grid, 1, 0, index, i, j, 1);
                        memo[i][j][index][0] = t;
                        memo[i][j][index][1] = t;
                        ans = max(ans, t);
                    }
                }
            }
        }

        cout << "Debug: cnt = " << cnt << endl; 
        
        return ans;
    }   
private:
    const int LIMIT = 500000;
    int Dfs(vector<vector<int>>& grid, int cur_len, int is_changed, int index, int i, int j, int last_val) {
        int nx_i = i + dir[index][0];
        int nx_j = j + dir[index][1];
        int flag = 1;
        if(nx_i < 0 || nx_i >= m || nx_j < 0 || nx_j >= n) {
            flag = 0;
        }
        int val = -1, ans_nc = cur_len;
        if(flag) {
            val = grid[nx_i][nx_j];
            if(cur_len > 1 && ((last_val == 2 && val != 0) || (last_val == 0 && val != 2))) {
                flag = 0;
            }
            if(cur_len == 1 && val != 2) {
                flag = 0;
            }
            if(flag) {
                if(is_changed && memo[nx_i][nx_j][index][is_changed]) {
                    ans_nc += memo[nx_i][nx_j][index][is_changed];
                }
                else if((!is_changed) && memo[nx_i][nx_j][index][is_changed]) {
                    ans_nc += memo[nx_i][nx_j][index][is_changed];
                }
                else {
                    ++ cnt;
                    ans_nc = Dfs(grid, cur_len + 1, is_changed, index, nx_i, nx_j, val);
                    memo[nx_i][nx_j][index][is_changed] = ans_nc - cur_len;

                }
            }
        }
        if(is_changed) {
            return ans_nc;
        }
        index = (index + 1) % 4;
        is_changed = 1;
        nx_i = i + dir[index][0];
        nx_j = j + dir[index][1];
        if(nx_i < 0 || nx_i >= m || nx_j < 0 || nx_j >= n) {
            return ans_nc;
        }
        val = grid[nx_i][nx_j];
        if(cur_len > 1 && ((last_val == 2 && val != 0) || (last_val == 0 && val != 2))) {
            return ans_nc;
        }
        if(cur_len == 1 && val != 2) {
            return ans_nc;
        }
        int ans_ic = cur_len;
        if(is_changed && memo[nx_i][nx_j][index][is_changed]) {
            ans_ic += memo[nx_i][nx_j][index][is_changed];
        }
        else if((!is_changed) && memo[nx_i][nx_j][index][is_changed]) {
            ans_ic += memo[nx_i][nx_j][index][is_changed];
        }
        else {
            ++ cnt;
            ans_ic = Dfs(grid, cur_len + 1, is_changed, index, nx_i, nx_j, val);
            memo[nx_i][nx_j][index][is_changed] = ans_ic - cur_len;
        }
        return max(ans_ic, ans_nc);
    }
    int m, n, cnt, ans;
    int dir[4][2] = {-1, -1, -1, +1, +1, +1, +1, -1};
};

